import { WsNotifyService } from './ws-notify.service'
export default {
  name: 'NotifyCenter',
  methods: {
    onClickNotify() {
      this.$router.push({ name: 'common-notify' })
    }
  },
  serviceInject() {
    return {
      service: WsNotifyService
    }
  },
  rxState() {
    const { notReadNum$ } = this.service
    return {
      notReadNum$
    }
  },
  created() {
    this.service.initWs()
    this.service.init().subscribe()
  }
}
